import styled from "styled-components";

export const CartIconStyle = styled.div`
  width: 45px;
  height: 45px;
  position: relative;
  cursor: pointer;
  display: flex;
  align-items: center;
  justify-content: center;
`;

export const ShoppingIconStyle = styled.img`
  width: 24px;
  height: 24px;
`;

export const ItemCountsStyle = styled.span`
  position: absolute;
  bottom: 12px;
  font-size: 10px;
  font-weight: bold;
`;
